import './App.css';
import React from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";

class App extends React.Component {
  constructor(){
    super();
  }

  render(){
    return (
      <div>    
        <Router>
          <div>
            <nav>
              <ul>
                <li>
                  <Link to="/">Home</Link>
                </li>
                <li>
                  <Link to="/about">About</Link>
                </li>
                <li>
                  <Link to="/users">Users</Link>
                </li>
              </ul>
            </nav>

            <Routes>
              <Route path="/about">
                <About />
              </Route>
              <Route path="/users">
                <Users />
              </Route>
              <Route path="/">
                <Home />
              </Route>
            </Routes>
          </div>
        </Router>
      </div>
    )
  }
}

class Home extends React.Component{
  render(){
    return(
      <h2>Home</h2>
    )
  }
}

class About extends React.Component{
  render(){
    return(
      <h2>About</h2>
    )
  }
}

class Users extends React.Component{
  render(){
    return(
      <h2>Users</h2>
    )
  }
}

export default App;
